import React from 'react';
import styled from 'styled-components'

const A = styled.a `
font-family: 'Montserrat', sans-serif;
`
const Headwrapper = styled.div `

background: #2A2F36;
margin: 0px;

`

const Div = styled.div`
margin = 0

`

function Header() {
  return (
    <Headwrapper>

        <header>

            <div className = "logo">
                LOGO
            </div>

            <nav>
                <ul>
                    <li>
                        <A href = "#">Hem</A>
                    </li>
                </ul>
            </nav>





        </header>
    </Headwrapper>
  );
}

export default Header;
